import konkukPic from "../image/ku_pics.png"
import "../index.css"
export default function Header(){

    return (
        <div style={{ display: "flex", alignItems: "center" }} className="konkuk_pic">
          <img
            style={{
              width: "103px",
              height: "37px",
              marginTop: "14px",
              marginLeft: "18px",
              marginRight: "8px", // 이미지와 텍스트 사이 간격
            }}
            alt="konkuk_pic"
            src={konkukPic}
          />
          <span style={{ 
            textAlign: "center",
            marginTop:8,
            fontSize:20
         }}>수강신청 연습시스템</span>
        </div>
      );
}//103 30
